            <p>   On a separate benefit enrollment form(s), I have enrolled for certain insurance coverage(s) and understand that an amount equal to the total amount of premium and/or contribution for coverage(s) elected less any nonelective employer contribution allocable thereto will be withheld from my salary, continuing for each pay period until this agreement is amended or terminated. The amount of my required contribution is set forth on a schedule that has been provided to me. In the event of a rate change, I authorize a corresponding change in the amount deducted from my salary without signing a new Salary Redirection Agreement. If the rate change is brought on by the third-party carrier (insurance company), the premium increase or decrease can be deducted pre-tax. However, if this change is brought on by my employer, the increase must be deducted after-tax. I understand that my actual take-home pay may be higher or lower depending on the coverage I select. In addition, pre-tax contributions reduce my compensation for Social Security tax purposes, therefore, my Social<br />Security benefits could be decreased.</p>
